let form = document.querySelector('#f')
let url = '#'
let img = document.querySelector('#img')
form.onsubmit = (e) => {
    e.preventDefault()
    let name = form.ten.value
    for(let i of qua){
        if(name == i.ten){
            url = i.url
        }
    }
    img.src = url
}
